SamIdentifyBlacklistedSoftware.prototype = Object.extendsObject(global.AssetManagementPerGlideRecordBaseJob, {
	initialize: function() {
	},

	getRecords: function() {
		return new SampBlacklistEngine().getBlacklistedSoftwareModels();
	},

